    "ЁЭЧЦЁЭЧЫЁЭЧФЁЭЧЯ ЁЭЧХЁЭЧШЁЭЧзЁЭЧФ ЁЭЧзЁЭЧиЁЭЧЭЁЭЧЫЁЭЧШ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЩ ЁЭЧЮЁЭЧЬЁЭЧФ ЁЯдг ЁЭЧФЁЭЧХЁЭЧХ ЁЭЧФЁЭЧгЁЭЧбЁЭЧЬ ЁЭЧЪЁЭЧЩ ЁЭЧЮЁЭЧв ЁЭЧХЁЭЧЫЁЭЧШЁЭЧЭ",
    "ЁЭЧжЁЭЧЫЁЭЧФЁЭЧеЁЭЧФЁЭЧа ЁЭЧЮЁЭЧФЁЭЧе ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧХЁЭЧШ╠БЁЭЧЫЁЭЧШЁЭЧб ЁЭЧЮЁЭЧФ ЁЭЧХЁЭЧЫЁЭЧвЁЭЧжЁЭЧЧЁЭЧФ ЁЭЧЮЁЭЧЬЁЭЧзЁЭЧбЁЭЧФ ЁЭЧЪЁЭЧФЁЭЧФЁЭЧЯЁЭЧЬЁЭЧФ ЁЭЧжЁЭЧиЁЭЧбЁЭЧкЁЭЧФЁЭЧмЁЭЧШЁЭЧЪЁЭЧФ ЁЭЧФЁЭЧгЁЭЧбЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧФ ЁЭЧХЁЭЧШ╠БЁЭЧЫЁЭЧШЁЭЧб ЁЭЧЮЁЭЧШ ЁЭЧиЁЭЧгЁЭЧШЁЭЧе",
    "ЁЭЧФЁЭЧХЁЭЧШ ЁЭЧе├ЖЁЭЧбЁЭЧЧЁЭЧЬЁЭЧЮЁЭЧШ ЁЭЧХЁЭЧФЁЭЧЦЁЭЧЫЁЭЧЫЁЭЧШ ЁЭЧФЁЭЧиЁЭЧЮЁЭЧФЁЭЧз ЁЭЧбЁЭЧЫЁЭЧЬ ЁЭЧЫЁЭЧШЁЭЧзЁЭЧв ЁЭЧФЁЭЧгЁЭЧбЁЭЧЬ ЁЭЧе├ЖЁЭЧбЁЭЧЧЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧв ЁЭЧЯЁЭЧШЁЭЧЮЁЭЧШ ЁЭЧФЁЭЧФЁЭЧмЁЭЧФ ЁЭЧаЁЭЧФЁЭЧзЁЭЧЫ ЁЭЧЮЁЭЧФЁЭЧе ЁЭЧЫЁЭЧФЁЭЧЫЁЭЧФЁЭЧЫЁЭЧФЁЭЧЫЁЭЧФ",
    "ЁЭЧЮЁЭЧЬЁЭЧЧЁЭЧн ЁЭЧаЁЭЧФ╠ВЁЭЧФ╠ВЁЭЧЧЁЭЧФЁЭЧеЁЭЧЦЁЭЧЫ├ШЁЭЧЧ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧв ЁЭЧЦЁЭЧЫЁЭЧвЁЭЧЧ ЁЭЧЦЁЭЧЫЁЭЧвЁЭЧЧЁЭЧЮЁЭЧШ ЁЭЧзЁЭЧШЁЭЧеЁЭЧе ЁЭЧЯЁЭЧЬЁЭЧмЁЭЧШ ЁЭЧХЁЭЧЫЁЭЧФЁЭЧЬ ЁЭЧЧЁЭЧШЁЭЧЧЁЭЧЬЁЭЧмЁЭЧФ",
    "ЁЭЧЭЁЭЧиЁЭЧбЁЭЧЪЁЭЧЯЁЭЧШ ЁЭЧаЁЭЧШ ЁЭЧбЁЭЧФЁЭЧЦЁЭЧЫЁЭЧзЁЭЧФ ЁЭЧЫЁЭЧШ ЁЭЧаЁЭЧвЁЭЧеЁЭЧШ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧЬ ЁЭЧЦЁЭЧЫЁЭЧиЁЭЧЧЁЭЧФЁЭЧЬ ЁЭЧЧЁЭЧШЁЭЧЮЁЭЧЮЁЭЧШ ЁЭЧжЁЭЧФЁЭЧХ ЁЭЧХЁЭЧвЁЭЧЯЁЭЧзЁЭЧШ ЁЭЧвЁЭЧбЁЭЧЦЁЭЧШ ЁЭЧаЁЭЧвЁЭЧеЁЭЧШ ЁЭЧвЁЭЧбЁЭЧЦЁЭЧШ ЁЭЧаЁЭЧвЁЭЧеЁЭЧШ ЁЯдгЁЯдгЁЯТжЁЯТЛ",
    "ЁЭЧЪЁЭЧФЁЭЧЯЁЭЧЬ ЁЭЧЪЁЭЧФЁЭЧЯЁЭЧЬ ЁЭЧаЁЭЧШ ЁЭЧеЁЭЧШЁЭЧЫЁЭЧзЁЭЧФ ЁЭЧЫЁЭЧШ ЁЭЧжЁЭЧФЁЭЧбЁЭЧЧ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧв ЁЭЧЦЁЭЧЫЁЭЧвЁЭЧЧ ЁЭЧЧЁЭЧФЁЭЧЯЁЭЧФ ЁЭЧвЁЭЧе ЁЭЧХЁЭЧФЁЭЧбЁЭЧФ ЁЭЧЧЁЭЧЬЁЭЧФ ЁЭЧеЁЭЧФЁЭЧбЁЭЧЧ ЁЯддЁЯдг",
    "ЁЭЧжЁЭЧФЁЭЧХ ЁЭЧХЁЭЧвЁЭЧЯЁЭЧзЁЭЧШ ЁЭЧаЁЭЧиЁЭЧЭЁЭЧЫЁЭЧЮЁЭЧв ЁЭЧгЁЭЧФЁЭЧгЁЭЧФ ЁЭЧЮЁЭЧмЁЭЧвЁЭЧиЁЭЧбЁЭЧЮЁЭЧЬ ЁЭЧаЁЭЧШЁЭЧбЁЭЧШ ЁЭЧХЁЭЧФЁЭЧбЁЭЧФЁЭЧЧЁЭЧЬЁЭЧФ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧв ЁЭЧгЁЭЧеЁЭЧШЁЭЧЪЁЭЧбЁЭЧШЁЭЧбЁЭЧз ЁЯдгЁЯдг",
    "ЁЭЧжЁЭЧиЁЭЧФЁЭЧе ЁЭЧЮЁЭЧШ ЁЭЧгЁЭЧЬЁЭЧЯЁЭЧЯЁЭЧШ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧЬ ЁЭЧЦЁЭЧЫЁЭЧиЁЭЧи╠БЁЭЧзЁЭЧЫ ЁЭЧаЁЭЧШ ЁЭЧжЁЭЧиЁЭЧФЁЭЧе ЁЭЧЮЁЭЧФ ЁЭЧЯЁЭЧвЁЭЧиЁЭЧЧЁЭЧФ ЁЭЧвЁЭЧе ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧХЁЭЧШ╠БЁЭЧЫЁЭЧШЁЭЧб ЁЭЧЮЁЭЧЬ ЁЭЧЦЁЭЧЫЁЭЧиЁЭЧи╠БЁЭЧзЁЭЧЫ ЁЭЧаЁЭЧШ ЁЭЧаЁЭЧШЁЭЧеЁЭЧФ ЁЭЧЯЁЭЧвЁЭЧЧЁЭЧФ",
    "ЁЭЧЦЁЭЧЫЁЭЧФЁЭЧЯ ЁЭЧЦЁЭЧЫЁЭЧФЁЭЧЯ ЁЭЧФЁЭЧгЁЭЧбЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧЬ ЁЭЧЦЁЭЧЫЁЭЧиЁЭЧЦЁЭЧЫЁЭЧЬЁЭЧмЁЭЧФ ЁЭЧЧЁЭЧЬЁЭЧЮЁЭЧФ",
    "ЁЭЧЫЁЭЧФЁЭЧЫЁЭЧФЁЭЧЫЁЭЧФЁЭЧЫЁЭЧФ ЁЭЧХЁЭЧФЁЭЧЦЁЭЧЫЁЭЧЫЁЭЧШ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧФЁЭЧЮЁЭЧв ЁЭЧЦЁЭЧЫЁЭЧвЁЭЧЧ ЁЭЧЧЁЭЧЬЁЭЧФ ЁЭЧбЁЭЧФЁЭЧбЁЭЧЪЁЭЧФ ЁЭЧЮЁЭЧФЁЭЧеЁЭЧЮЁЭЧШ",
    "ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧЪЁЭЧЩ ЁЭЧЫЁЭЧШ ЁЭЧХЁЭЧФЁЭЧЧЁЭЧЬ ЁЭЧжЁЭЧШЁЭЧлЁЭЧм ЁЭЧиЁЭЧжЁЭЧЮЁЭЧв ЁЭЧгЁЭЧЬЁЭЧЯЁЭЧФЁЭЧЮЁЭЧШ ЁЭЧЦЁЭЧЫЁЭЧвЁЭЧвЁЭЧЧЁЭЧШЁЭЧбЁЭЧЪЁЭЧШ ЁЭЧгЁЭЧШЁЭЧгЁЭЧжЁЭЧЬ",
    "2 ЁЭЧеЁЭЧиЁЭЧгЁЭЧФЁЭЧм ЁЭЧЮЁЭЧЬ ЁЭЧгЁЭЧШЁЭЧгЁЭЧжЁЭЧЬ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧиЁЭЧаЁЭЧаЁЭЧм ЁЭЧжЁЭЧФЁЭЧХЁЭЧжЁЭЧШ ЁЭЧжЁЭЧШЁЭЧлЁЭЧм ЁЯТЛЁЯТж",
    "ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧв ЁЭЧЦЁЭЧЫЁЭЧШЁЭЧШЁЭЧаЁЭЧж ЁЭЧжЁЭЧШ ЁЭЧЦЁЭЧЫЁЭЧиЁЭЧЧЁЭЧкЁЭЧФЁЭЧйЁЭЧиЁЭЧбЁЭЧЪЁЭЧФ ЁЭЧаЁЭЧФЁЭЧЧЁЭЧШЁЭЧеЁЭЧЦЁЭЧЫЁЭЧвЁЭЧвЁЭЧЧ ЁЭЧЮЁЭЧШ ЁЭЧгЁЭЧЬЁЭЧЯЁЭЧЯЁЭЧШ ЁЯТжЁЯдг",
    "ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧХЁЭЧШ╠БЁЭЧЫЁЭЧШЁЭЧб ЁЭЧЮЁЭЧЬ ЁЭЧЦЁЭЧЫЁЭЧиЁЭЧи╠БЁЭЧзЁЭЧЫ ЁЭЧаЁЭЧШ ЁЭЧаЁЭЧиЁЭЧзЁЭЧЫЁЭЧЮЁЭЧШ ЁЭЧЩЁЭЧФЁЭЧеЁЭЧФЁЭЧе ЁЭЧЫЁЭЧвЁЭЧЭЁЭЧФЁЭЧйЁЭЧиЁЭЧбЁЭЧЪЁЭЧФ ЁЭЧЫЁЭЧиЁЭЧЬ ЁЭЧЫЁЭЧиЁЭЧЬ ЁЭЧЫЁЭЧиЁЭЧЬ",
    "ЁЭЧжЁЭЧгЁЭЧШЁЭЧШЁЭЧЧ ЁЭЧЯЁЭЧФЁЭЧФЁЭЧФ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧХЁЭЧШ╠БЁЭЧЫЁЭЧШЁЭЧб ЁЭЧЦЁЭЧЫЁЭЧвЁЭЧЧЁЭЧи ЁЭЧе├ЖЁЭЧбЁЭЧЧЁЭЧЬЁЭЧЮЁЭЧШ ЁЭЧгЁЭЧЬЁЭЧЯЁЭЧЯЁЭЧШ ЁЯТЛЁЯТжЁЯдг",
    "ЁЭЧФЁЭЧеЁЭЧШ ЁЭЧеЁЭЧШ ЁЭЧаЁЭЧШЁЭЧеЁЭЧШ ЁЭЧХЁЭЧШЁЭЧзЁЭЧШ ЁЭЧЮЁЭЧмЁЭЧвЁЭЧиЁЭЧб ЁЭЧжЁЭЧгЁЭЧШЁЭЧШЁЭЧЧ ЁЭЧгЁЭЧФЁЭЧЮЁЭЧФЁЭЧЧ ЁЭЧбЁЭЧФ ЁЭЧгЁЭЧФЁЭЧФЁЭЧФ ЁЭЧеЁЭЧФЁЭЧЫЁЭЧФ ЁЭЧФЁЭЧгЁЭЧбЁЭЧШ ЁЭЧХЁЭЧФЁЭЧФЁЭЧг ЁЭЧЮЁЭЧФ ЁЭЧЫЁЭЧФЁЭЧЫЁЭЧФЁЭЧЫЁЯдгЁЯдг",
    "ЁЭЧжЁЭЧиЁЭЧб ЁЭЧжЁЭЧиЁЭЧб ЁЭЧжЁЭЧиЁЭЧФЁЭЧе ЁЭЧЮЁЭЧШ ЁЭЧгЁЭЧЬЁЭЧЯЁЭЧЯЁЭЧШ ЁЭЧЭЁЭЧЫЁЭЧФЁЭЧбЁЭЧзЁЭЧв ЁЭЧЮЁЭЧШ ЁЭЧжЁЭЧвЁЭЧиЁЭЧЧЁЭЧФЁЭЧЪЁЭЧФЁЭЧе ЁЭЧФЁЭЧгЁЭЧбЁЭЧЬ ЁЭЧаЁЭЧиЁЭЧаЁЭЧаЁЭЧм ЁЭЧЮЁЭЧЬ ЁЭЧбЁЭЧиЁЭЧЧЁЭЧШЁЭЧж ЁЭЧХЁЭЧЫЁЭЧШЁЭЧЭ",
    "ЁЭЧФЁЭЧХЁЭЧШ ЁЭЧжЁЭЧиЁЭЧб ЁЭЧЯЁЭЧвЁЭЧЧЁЭЧШ ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧХЁЭЧШ╠БЁЭЧЫЁЭЧШЁЭЧб ЁЭЧЮЁЭЧФ ЁЭЧХЁЭЧЫЁЭЧвЁЭЧжЁЭЧЧЁЭЧФ ЁЭЧЩЁЭЧФЁЭЧФЁЭЧЧ ЁЭЧЧЁЭЧиЁЭЧбЁЭЧЪЁЭЧФ",
    "ЁЭЧзЁЭЧШЁЭЧеЁЭЧЬ ЁЭЧаЁЭЧФ╠БЁЭЧФ╠АЁЭЧЮЁЭЧв ЁЭЧЮЁЭЧЫЁЭЧиЁЭЧЯЁЭЧШ ЁЭЧХЁЭЧФЁЭЧЭЁЭЧФЁЭЧе ЁЭЧаЁЭЧШ ЁЭЧЦЁЭЧЫЁЭЧвЁЭЧЧ ЁЭЧЧЁЭЧФЁЭЧЯЁЭЧФ ЁЯдгЁЯдгЁЯТЛ",
    "ЁЭРМЁЭРАЁЭРГЁЭРАЁЭРСЁЭРВЁЭРЗЁЭРОЁЭРГ ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРЖЁЭРЗЁЭРФЁЭРУЁЭРКЁЭРА ЁЭРКЁЭРЗЁЭРАЁЭРАЁЭРКЁЭРД ЁЭРУЁЭРЗЁЭРОЁЭРОЁЭРК ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЯдгЁЯдг",
    "ЁЭРУЁЭРДЁЭРСЁЭРД ЁЭРБЁЭРДЁЭРЗЁЭРДЁЭРН ЁЭРК ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРВЁЭРЗЁЭРАЁЭРКЁЭРФ ЁЭРГЁЭРАЁЭРАЁЭРЛ ЁЭРКЁЭРАЁЭРС ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРКЁЭРА ЁЭРКЁЭРЗЁЭРОЁЭРОЁЭРН ЁЭРКЁЭРАЁЭРС ЁЭРГЁЭРФЁЭРЖЁЭРА", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРХЁЭРАЁЭРЗЁЭРДЁЭРДЁЭРН ЁЭРНЁЭРЗЁЭРИ ЁЭРЗЁЭРАЁЭРИ ЁЭРКЁЭРШЁЭРА? ЁЭЯЧ ЁЭРМЁЭРАЁЭРЗЁЭРИЁЭРНЁЭРД ЁЭРСЁЭРФЁЭРК ЁЭРТЁЭРАЁЭРЖЁЭРИ ЁЭРХЁЭРАЁЭРЗЁЭРДЁЭРДЁЭРН ЁЭРГЁЭРДЁЭРУЁЭРА ЁЭРЗЁЭРФ ЁЯдгЁЯдгЁЯдй", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРК ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРД ЁЭРМЁЭРД ЁЭРАЁЭРДЁЭРСЁЭРОЁЭРПЁЭРЛЁЭРАЁЭРНЁЭРДЁЭРПЁЭРАЁЭРСЁЭРК ЁЭРКЁЭРАЁЭРСЁЭРКЁЭРД ЁЭРФЁЭРГЁЭРАЁЭРАЁЭРН ЁЭРБЁЭРЗЁЭРАЁЭРС ЁЭРГЁЭРФЁЭРЖЁЭРА тЬИя╕ПЁЯЫл", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРТЁЭРФЁЭРУЁЭРЛЁЭРИ ЁЭРБЁЭРОЁЭРМЁЭРБ ЁЭРЕЁЭРОЁЭРГ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРЙЁЭРЗЁЭРАЁЭРАЁЭРУЁЭРД ЁЭРЙЁЭРАЁЭРЛ ЁЭРКЁЭРД ЁЭРКЁЭРЗЁЭРАЁЭРАЁЭРК ЁЭРЗЁЭРО ЁЭРЙЁЭРАЁЭРШЁЭРДЁЭРЖЁЭРИЁЯТг", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРАЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРТЁЭРВЁЭРОЁЭРОЁЭРУЁЭРДЁЭРС ЁЭРГЁЭРАЁЭРАЁЭРЛ ЁЭРГЁЭРФЁЭРЖЁЭРАЁЯСЕ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРД ЁЭРБЁЭРДЁЭРЗЁЭРДЁЭРН ЁЭРК ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРВЁЭРЗЁЭРАЁЭРКЁЭРФ ЁЭРГЁЭРАЁЭРАЁЭРЛ ЁЭРКЁЭРАЁЭРС ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРКЁЭРА ЁЭРКЁЭРЗЁЭРОЁЭРОЁЭРН ЁЭРКЁЭРАЁЭРС ЁЭРГЁЭРФЁЭРЖЁЭРА", 
    "ЁЭРУЁЭРДЁЭРСЁЭРД ЁЭРБЁЭРДЁЭРЗЁЭРДЁЭРН ЁЭРК ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРВЁЭРЗЁЭРАЁЭРКЁЭРФ ЁЭРГЁЭРАЁЭРАЁЭРЛ ЁЭРКЁЭРАЁЭРС ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРКЁЭРА ЁЭРКЁЭРЗЁЭРОЁЭРОЁЭРН ЁЭРКЁЭРАЁЭРС ЁЭРГЁЭРФЁЭРЖЁЭРА", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРКЁЭРАЁЭРКЁЭРУЁЭРД ЁЯд▒ ЁЭРЖЁЭРАЁЭРЛЁЭРИ ЁЭРКЁЭРД ЁЭРКЁЭРФЁЭРУЁЭРУЁЭРО ЁЯжо ЁЭРМЁЭРД ЁЭРБЁЭРАЁЭРАЁЭРУ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРПЁЭРЗЁЭРИЁЭРС ЁЯНЮ ЁЭРБЁЭРСЁЭРДЁЭРАЁЭРГ ЁЭРКЁЭРИ ЁЭРУЁЭРАЁЭРСЁЭРЗ ЁЭРКЁЭРЗЁЭРАЁЭРШЁЭРДЁЭРНЁЭРЖЁЭРД ЁЭРЦЁЭРО ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ", 
    "ЁЭРГЁЭРФЁЭРГЁЭРЗ ЁЭРЗЁЭРИЁЭРЛЁЭРАЁЭРАЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРХЁЭРАЁЭРЗЁЭРДЁЭРДЁЭРН ЁЭРКЁЭРД ЁЭРФЁЭРПЁЭРС ЁЭРНЁЭРИЁЭРВЁЭРЗЁЭРД ЁЯЖЩЁЯЖТЁЯШЩ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД тЬЛ ЁЭРЗЁЭРАЁЭРУЁЭРУЁЭРЗ ЁЭРГЁЭРАЁЭРЛЁЭРКЁЭРД ЁЯС╢ ЁЭРБЁЭРАЁЭРВЁЭРВЁЭРЗЁЭРД ЁЭРНЁЭРИЁЭРКЁЭРАЁЭРЛ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЯШН", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРДЁЭРЗЁЭРН ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРКЁЭРДЁЭРЛЁЭРД ЁЭРКЁЭРД ЁЭРВЁЭРЗЁЭРИЁЭРЛЁЭРКЁЭРД ЁЯНМЁЯНМЁЯШН", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРФЁЭРТЁЭРДЁЭРСЁЭРБЁЭРОЁЭРУ ЁЭРЛЁЭРАЁЭРЖЁЭРАЁЭРАЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРТЁЭРАЁЭРТЁЭРУЁЭРД ЁЭРТЁЭРПЁЭРАЁЭРМ ЁЭРКЁЭРД ЁЭРВЁЭРЗЁЭРОЁЭРГЁЭРД", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРХЁЭРАЁЭРЗЁЭРДЁЭРДЁЭРН ЁЭРГЁЭРЗЁЭРАЁЭРНЁЭРГЁЭРЗЁЭРД ЁЭРХЁЭРАЁЭРАЁЭРЛЁЭРИ ЁЯШЛЁЯШЫ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРД ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРД ЁЭРМЁЭРД ЁЭРАЁЭРВ ЁЭРЛЁЭРАЁЭРЖЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРТЁЭРАЁЭРАЁЭРСЁЭРИ ЁЭРЖЁЭРАЁЭРСЁЭРМЁЭРИ ЁЭРНЁЭРИЁЭРКЁЭРАЁЭРЛ ЁЭРЙЁЭРАЁЭРАЁЭРШЁЭРДЁЭРЖЁЭРИ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРХЁЭРАЁЭРЗЁЭРДЁЭРДЁЭРН ЁЭРКЁЭРО ЁЭРЗЁЭРОЁЭРСЁЭРЛЁЭРИЁЭРВЁЭРКЁЭРТ ЁЭРПЁЭРДЁЭРДЁЭРЛЁЭРАЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРМЁЭРАЁЭРГЁЭРАЁЭРСЁЭРВЁЭРЗЁЭРОЁЭРГЁЯШЪ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРЖЁЭРАЁЭРАЁЭРНЁЭРГ ЁЭРМЁЭРД ЁЭРТЁЭРАЁЭРСЁЭРИЁЭРШЁЭРА ЁЭРГЁЭРАЁЭРАЁЭРЛ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРМЁЭРАЁЭРГЁЭРАЁЭРСЁЭРВЁЭРЗЁЭРОЁЭРГ ЁЭРФЁЭРТЁЭРИ ЁЭРТЁЭРАЁЭРСЁЭРИЁЭРШЁЭРД ЁЭРПЁЭРС ЁЭРУЁЭРАЁЭРНЁЭРЖ ЁЭРКЁЭРД ЁЭРБЁЭРАЁЭРВЁЭРЗЁЭРД ЁЭРПЁЭРАЁЭРИЁЭРГЁЭРА ЁЭРЗЁЭРОЁЭРНЁЭРЖЁЭРД ЁЯШ▒ЁЯШ▒", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРО ЁЭРКЁЭРОЁЭРЛЁЭРКЁЭРАЁЭРУЁЭРА ЁЭРХЁЭРАЁЭРАЁЭРЛЁЭРД ЁЭРЙЁЭРИЁЭРУЁЭРФ ЁЭРБЁЭРЗЁЭРАЁЭРИЁЭРШЁЭРА ЁЭРКЁЭРА ЁЭРЛЁЭРФЁЭРНЁЭРГ ЁЭРМЁЭРФЁЭРБЁЭРАЁЭРСЁЭРАЁЭРК ЁЯдйЁЯдй", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРФЁЭРМЁЭРМЁЭРШ ЁЭРКЁЭРИ ЁЭРЕЁЭРАЁЭРНЁЭРУЁЭРАЁЭРТЁЭРШ ЁЭРЗЁЭРФ ЁЭРЛЁЭРАЁЭРЦЁЭРГЁЭРД, ЁЭРУЁЭРФ ЁЭРАЁЭРПЁЭРНЁЭРИ ЁЭРБЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРО ЁЭРТЁЭРМЁЭРБЁЭРЗЁЭРАЁЭРАЁЭРЛ ЁЯШИЁЯШИ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРА ЁЭРПЁЭРДЁЭРЗЁЭРЛЁЭРА ЁЭРБЁЭРАЁЭРАЁЭРП ЁЭРЗЁЭРФ ЁЭРМЁЭРАЁЭРГЁЭРАЁЭРСЁЭРВЁЭРЗЁЭРОЁЭРГ ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРХЁЭРАЁЭРЗЁЭРДЁЭРДЁЭРН ЁЭРКЁЭРД ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРД ЁЭРМЁЭРД ЁЭРЧЁЭРХЁЭРИЁЭРГЁЭРДЁЭРОЁЭРТ.ЁЭРВЁЭРОЁЭРМ ЁЭРВЁЭРЗЁЭРАЁЭРЛЁЭРА ЁЭРКЁЭРД ЁЭРМЁЭРФЁЭРУЁЭРЗ ЁЭРМЁЭРАЁЭРАЁЭРСЁЭРФЁЭРНЁЭРЖЁЭРА ЁЯдбЁЯШ╣", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРА ЁЭРЖЁЭРСЁЭРОЁЭРФЁЭРП ЁЭРХЁЭРАЁЭРАЁЭРЛЁЭРОЁЭРН ЁЭРТЁЭРАЁЭРАЁЭРУЁЭРЗ ЁЭРМЁЭРИЁЭРЛЁЭРКЁЭРД ЁЭРЖЁЭРАЁЭРНЁЭРЖ ЁЭРБЁЭРАЁЭРНЁЭРЖ ЁЭРКЁЭРСЁЭРФЁЭРНЁЭРЖЁЭРАЁЯЩМЁЯП╗тШая╕П ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРИЁЭРУЁЭРДЁЭРМ ЁЭРКЁЭРИ ЁЭРЖЁЭРАЁЭРАЁЭРНЁЭРГ ЁЭРМЁЭРД ЁЭРЛЁЭРФЁЭРНЁЭРГ ЁЭРГЁЭРАЁЭРАЁЭРЛЁЭРКЁЭРД,ЁЭРУЁЭРДЁЭРСЁЭРД ЁЭРЙЁЭРАЁЭРИЁЭРТЁЭРА ЁЭРДЁЭРК ЁЭРОЁЭРС ЁЭРНЁЭРИЁЭРКЁЭРАЁЭРАЁЭРЛ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРМЁЭРАЁЭРГЁЭРАЁЭРСЁЭРВЁЭРЗЁЭРОЁЭРГЁЯдШЁЯП╗ЁЯЩМЁЯП╗тШая╕П ", 
    "ЁЭРАЁЭРФЁЭРКЁЭРАЁЭРАЁЭРУ ЁЭРМЁЭРД ЁЭРСЁЭРДЁЭРЗ ЁЭРХЁЭРСЁЭРНЁЭРА ЁЭРЖЁЭРАЁЭРАЁЭРНЁЭРГ ЁЭРМЁЭРД ЁЭРГЁЭРАЁЭРНЁЭРГЁЭРА ЁЭРГЁЭРАЁЭРАЁЭРЛ ЁЭРКЁЭРД ЁЭРМЁЭРФЁЭРЗ ЁЭРТЁЭРД ЁЭРНЁЭРИЁЭРКЁЭРАЁЭРАЁЭРЛ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРТЁЭРЗЁЭРАЁЭРСЁЭРИЁЭРС ЁЭРБЁЭРЗЁЭРИ ЁЭРГЁЭРАЁЭРНЁЭРГЁЭРД ЁЭРЙЁЭРДЁЭРТЁЭРА ЁЭРГЁЭРИЁЭРКЁЭРЗЁЭРДЁЭРЖЁЭРА ЁЯЩДЁЯднЁЯдн", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРФЁЭРМЁЭРМЁЭРШ ЁЭРКЁЭРД ЁЭРТЁЭРАЁЭРАЁЭРУЁЭРЗ ЁЭРЛЁЭРФЁЭРГЁЭРО ЁЭРКЁЭРЗЁЭРДЁЭРЛЁЭРУЁЭРД ЁЭРКЁЭРЗЁЭРДЁЭРЛЁЭРУЁЭРД ЁЭРФЁЭРТЁЭРКЁЭРД ЁЭРМЁЭРФЁЭРЗ ЁЭРМЁЭРД ЁЭРАЁЭРПЁЭРНЁЭРА ЁЭРЛЁЭРОЁЭРГЁЭРА ЁЭРГЁЭРД ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАтШЭЁЯП╗тШЭЁЯП╗ЁЯШм", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРХЁЭРАЁЭРЗЁЭРДЁЭРДЁЭРН ЁЭРКЁЭРО ЁЭРАЁЭРПЁЭРНЁЭРД ЁЭРЛЁЭРФЁЭРНЁЭРГ ЁЭРПЁЭРС ЁЭРИЁЭРУЁЭРНЁЭРА ЁЭРЙЁЭРЗЁЭРФЁЭРЛЁЭРАЁЭРАЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРКЁЭРИ ЁЭРЙЁЭРЗЁЭРФЁЭРЛЁЭРУЁЭРД ЁЭРЙЁЭРЗЁЭРФЁЭРЛЁЭРУЁЭРД ЁЭРЗЁЭРИ ЁЭРБЁЭРАЁЭРВЁЭРЗЁЭРА ЁЭРПЁЭРАЁЭРИЁЭРГЁЭРА ЁЭРКЁЭРС ЁЭРГЁЭРДЁЭРЖЁЭРИЁЯСАЁЯСп ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРБЁЭРАЁЭРУЁЭРУЁЭРДЁЭРСЁЭРШ ЁЭРЛЁЭРАЁЭРЖЁЭРА ЁЭРКЁЭРД ЁЭРПЁЭРОЁЭРЦЁЭРДЁЭРСЁЭРБЁЭРАЁЭРНЁЭРК ЁЭРБЁЭРАЁЭРНЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЯФЛ ЁЯФеЁЯдй", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРВ++ ЁЭРТЁЭРУЁЭРСЁЭРИЁЭРНЁЭРЖ ЁЭРДЁЭРНЁЭРВЁЭРСЁЭРШЁЭРПЁЭРУЁЭРИЁЭРОЁЭРН ЁЭРЛЁЭРАЁЭРЖЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРБЁЭРАЁЭРЗЁЭРУЁЭРИ ЁЭРЗЁЭРФЁЭРШЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРСЁЭРФЁЭРК ЁЭРЙЁЭРАЁЭРШЁЭРДЁЭРЖЁЭРИЁЭРИЁЭРИЁЭРИЁЯШИЁЯФеЁЯШН", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРД ЁЭРЖЁЭРАЁЭРАЁЭРНЁЭРГ ЁЭРМЁЭРДЁЭРИ ЁЭРЙЁЭРЗЁЭРАЁЭРАЁЭРГЁЭРФ ЁЭРГЁЭРАЁЭРЛ ЁЭРКЁЭРД ЁЭРМЁЭРОЁЭРС ЁЯжЪ ЁЭРБЁЭРАЁЭРНЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРА ЁЯдйЁЯе╡ЁЯШ▒", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРТЁЭРЗЁЭРОЁЭРФЁЭРЛЁЭРГЁЭРДЁЭРСЁЭРИЁЭРНЁЭРЖ ЁЭРКЁЭРАЁЭРС ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРА ЁЭРЗЁЭРИЁЭРЛЁЭРАЁЭРУЁЭРД ЁЭРЗЁЭРФЁЭРШЁЭРД ЁЭРБЁЭРЗЁЭРИ ЁЭРГЁЭРАЁЭРСЁЭРГ ЁЭРЗЁЭРОЁЭРЖЁЭРАЁЭРАЁЭРАЁЯШ▒ЁЯдоЁЯС║", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРО ЁЭРСЁЭРДЁЭРГЁЭРИ ЁЭРПЁЭРД ЁЭРБЁЭРАЁЭРИЁЭРУЁЭРЗЁЭРАЁЭРЛ ЁЭРКЁЭРД ЁЭРФЁЭРТЁЭРТЁЭРД ЁЭРФЁЭРТЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРБЁЭРИЁЭРЛЁЭРЦЁЭРАЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРА ЁЯТ░ ЁЯШ╡ЁЯдй", 
    "ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРИЁЭРКЁЭРД ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭЯТ ЁЭРЗЁЭРОЁЭРЛЁЭРД ЁЭРЗЁЭРАЁЭРИ ЁЭРФЁЭРНЁЭРМЁЭРД ЁЭРМЁЭРТЁЭРДЁЭРАЁЭРЛ ЁЭРЛЁЭРАЁЭРЖЁЭРА ЁЭРБЁЭРАЁЭРЗЁЭРФЁЭРУ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРУЁЭРИ ЁЭРЗЁЭРАЁЭРИ ЁЭРБЁЭРЗЁЭРОЁЭРЕЁЭРГЁЭРИЁЭРКЁЭРДЁЯСКЁЯдоЁЯдвЁЯдв", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРБЁЭРАЁЭРСЁЭРЖЁЭРАЁЭРГ ЁЭРКЁЭРА ЁЭРПЁЭРДЁЭРГ ЁЭРФЁЭРЖЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРА ЁЭРВЁЭРОЁЭРСЁЭРОЁЭРНЁЭРА ЁЭРМЁЭРДЁЭРИ ЁЭРТЁЭРАЁЭРБ ЁЭРОЁЭРЧЁЭРШЁЭРЖЁЭРДЁЭРН ЁЭРЛЁЭРДЁЭРКЁЭРАЁЭРС ЁЭРЙЁЭРАЁЭРШЁЭРДЁЭРНЁЭРЖЁЭРДЁЯдвЁЯдйЁЯе│", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРТЁЭРФЁЭРГЁЭРО ЁЭРЛЁЭРАЁЭРЖЁЭРА ЁЭРКЁЭРД ЁЭРБЁЭРИЁЭРЖЁЭРТЁЭРПЁЭРАЁЭРМ ЁЭРЛЁЭРАЁЭРЖЁЭРА ЁЭРКЁЭРД ЁЭЯЧЁЭЯЧЁЭЯЧЁЭЯЧ ЁЭРЕЁЭРФЁЭРВЁЭРК ЁЭРЛЁЭРАЁЭРЖЁЭРАЁЭРА ЁЭРГЁЭРФ ЁЯдйЁЯе│ЁЯФе", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРХЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРД ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРИЁЭРКЁЭРД ЁЭРМЁЭРДЁЭРИ ЁЭРБЁЭРДЁЭРТЁЭРАЁЭРН ЁЭРКЁЭРД ЁЭРЛЁЭРАЁЭРГЁЭРГЁЭРФ ЁЭРБЁЭРЗЁЭРАЁЭРС ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЯдйЁЯе│ЁЯФеЁЯШИ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРКЁЭРЗЁЭРОЁЭРГ ЁЭРКЁЭРД ЁЭРФЁЭРТЁЭРМЁЭРД ЁЭРВЁЭРШЁЭРЛЁЭРИЁЭРНЁЭРГЁЭРДЁЭРС тЫ╜я╕П ЁЭРЕЁЭРИЁЭРУ ЁЭРКЁЭРАЁЭРСЁЭРКЁЭРД ЁЭРФЁЭРТЁЭРМЁЭРДЁЭРД ЁЭРГЁЭРАЁЭРЛ ЁЭРМЁЭРАЁЭРКЁЭРЗЁЭРАЁЭРНЁЭРИ ЁЭРБЁЭРАЁЭРНЁЭРАЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРАЁЭРАЁЯдйЁЯСКЁЯФе", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРТЁЭРЗЁЭРДЁЭРДЁЭРТЁЭРЗЁЭРА ЁЭРГЁЭРАЁЭРЛ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРАЁЭРА ЁЭРАЁЭРФЁЭРС ЁЭРВЁЭРЗЁЭРАЁЭРФЁЭРСЁЭРАЁЭРЗЁЭРД ЁЭРПЁЭРД ЁЭРУЁЭРАЁЭРАЁЭРНЁЭРЖ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРИЁЭРКЁЭРДЁЯШИЁЯШ▒ЁЯдй", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРВЁЭРСЁЭРДЁЭРГЁЭРИЁЭРУ ЁЭРВЁЭРАЁЭРСЁЭРГ ЁЭРГЁЭРАЁЭРЛ ЁЭРКЁЭРД ЁЭРАЁЭРЖЁЭРД ЁЭРТЁЭРД ЁЭЯУЁЭЯОЁЭЯО ЁЭРКЁЭРД ЁЭРКЁЭРАЁЭРАЁЭРСЁЭРД ЁЭРКЁЭРАЁЭРАЁЭРСЁЭРД ЁЭРНЁЭРОЁЭРУЁЭРД ЁЭРНЁЭРИЁЭРКЁЭРАЁЭРЛЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРА ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРИЁЭРКЁЭРДЁЯТ░ЁЯТ░ЁЯдй", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРД ЁЭРТЁЭРАЁЭРУЁЭРЗ ЁЭРТЁЭРФЁЭРАЁЭРС ЁЭРКЁЭРА ЁЭРТЁЭРДЁЭРЧ ЁЭРКЁЭРАЁЭРСЁЭРЦЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРА ЁЭРДЁЭРК ЁЭРТЁЭРАЁЭРУЁЭРЗ ЁЭЯФ-ЁЭЯФ ЁЭРБЁЭРАЁЭРВЁЭРЗЁЭРД ЁЭРГЁЭРДЁЭРЖЁЭРИЁЯТ░ЁЯФеЁЯШ▒", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРАЁЭРПЁЭРПЁЭРЛЁЭРД ЁЭРКЁЭРА ЁЭЯПЁЭЯЦЁЭРЦ ЁЭРЦЁЭРАЁЭРЛЁЭРА ЁЭРВЁЭРЗЁЭРАЁЭРСЁЭРЖЁЭРДЁЭРС ЁЯФеЁЯдй", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРИ ЁЭРЖЁЭРАЁЭРАЁЭРНЁЭРГ ЁЭРМЁЭРДЁЭРИ ЁЭРОЁЭРНЁЭРДЁЭРПЁЭРЛЁЭРФЁЭРТ ЁЭРКЁЭРА ЁЭРЦЁЭРСЁЭРАЁЭРП ЁЭРВЁЭРЗЁЭРАЁЭРСЁЭРЖЁЭРДЁЭРС ЁЭЯСЁЭЯОЁЭРЦ ЁЭРЗЁЭРИЁЭРЖЁЭРЗ ЁЭРПЁЭРОЁЭРЦЁЭРДЁЭРС ЁЯТеЁЯШВЁЯШО", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРКЁЭРО ЁЭРАЁЭРМЁЭРАЁЭРЩЁЭРОЁЭРН ЁЭРТЁЭРД ЁЭРОЁЭРСЁЭРГЁЭРДЁЭРС ЁЭРКЁЭРАЁЭРСЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭЯПЁЭЯО ЁЭРлЁЭРм ЁЭРМЁЭРДЁЭРИ ЁЭРАЁЭРФЁЭРС ЁЭРЕЁЭРЛЁЭРИЁЭРПЁЭРКЁЭРАЁЭРСЁЭРУ ЁЭРПЁЭРД ЁЭЯРЁЭЯО ЁЭРСЁЭРТ ЁЭРМЁЭРДЁЭРИ ЁЭРБЁЭРДЁЭРВЁЭРЗ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЯдоЁЯС┐ЁЯШИЁЯдЦ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРБЁЭРАЁЭРГЁЭРИ ЁЭРБЁЭРЗЁЭРФЁЭРНЁЭРГ ЁЭРМЁЭРД ЁЭРЩЁЭРОЁЭРМЁЭРАЁЭРУЁЭРО ЁЭРГЁЭРАЁЭРЛ ЁЭРКЁЭРД ЁЭРТЁЭРФЁЭРБЁЭРЦЁЭРАЁЭРШ ЁЭРКЁЭРА ЁЭРБЁЭРЕЁЭРЕ ЁЭРХЁЭРДЁЭРЖ ЁЭРТЁЭРФЁЭРБ ЁЭРВЁЭРОЁЭРМЁЭРБЁЭРО [ЁЭЯПЁЭЯУЁЭРЬЁЭРж , ЁЭЯПЁЭЯФ ЁЭРвЁЭРзЁЭРЬЁЭРбЁЭРЮЁЭРм ] ЁЭРОЁЭРСЁЭРГЁЭРДЁЭРС ЁЭРВЁЭРОЁЭРГ ЁЭРКЁЭРСЁЭРХЁЭРАЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРОЁЭРС ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРЙЁЭРАЁЭРБ ЁЭРГЁЭРИЁЭРЛЁЭРИЁЭРХЁЭРДЁЭРСЁЭРШ ЁЭРГЁЭРДЁЭРНЁЭРД ЁЭРАЁЭРШЁЭРДЁЭРЖЁЭРИ ЁЭРУЁЭРАЁЭРБ ЁЭРФЁЭРТЁЭРПЁЭРД ЁЭРЙЁЭРАЁЭРАЁЭРГЁЭРФ ЁЭРКЁЭРСЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРОЁЭРС ЁЭРЕЁЭРИЁЭРС ЁЭЯЧ ЁЭРМЁЭРОЁЭРНЁЭРУЁЭРЗ ЁЭРБЁЭРАЁЭРАЁЭРГ ЁЭРХЁЭРО ЁЭРДЁЭРК ЁЭРОЁЭРС ЁЭРЕЁЭРСЁЭРДЁЭРД ЁЭРГЁЭРИЁЭРЛЁЭРИЁЭРХЁЭРДЁЭРСЁЭРШ ЁЭРГЁЭРДЁЭРЖЁЭРИЁЯЩАЁЯСНЁЯе│ЁЯФе", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРКЁЭРАЁЭРАЁЭРЛЁЭРИЁЯЩБЁЯдгЁЯТе", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРД ЁЭРВЁЭРЗЁЭРАЁЭРНЁЭРЖЁЭРДЁЭРТ ЁЭРВЁЭРОЁЭРМЁЭРМЁЭРИЁЭРУ ЁЭРКЁЭРСЁЭРФЁЭРЖЁЭРА ЁЭРЕЁЭРИЁЭРС ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРЗЁЭРДЁЭРДЁЭРН ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРАЁЭРФЁЭРУЁЭРОЁЭРМЁЭРАЁЭРУЁЭРИЁЭРВЁЭРАЁЭРЛЁЭРЛЁЭРШ ЁЭРФЁЭРПЁЭРГЁЭРАЁЭРУЁЭРД ЁЭРЗЁЭРОЁЭРЙЁЭРАЁЭРАЁЭРШЁЭРДЁЭРЖЁЭРИЁЯдЦЁЯЩПЁЯдФ", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРФЁЭРТЁЭРИ ЁЭРКЁЭРД ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРД ЁЭРМЁЭРДЁЭРИ ЁЭРИЁЭРНЁЭРГЁЭРИЁЭРАЁЭРН ЁЭРСЁЭРАЁЭРИЁЭРЛЁЭРЦЁЭРАЁЭРШ ЁЯЪВЁЯТеЁЯШВ", 
    "ЁЭРУЁЭРФ ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРУЁЭРДЁЭРСЁЭРА ЁЭРКЁЭРЗЁЭРАЁЭРНЁЭРГЁЭРАЁЭРН ЁЭРТЁЭРАЁЭРБ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРД ЁЭРЛЁЭРАЁЭРЦЁЭРГЁЭРД ЁЭРСЁЭРАЁЭРНЁЭРГЁЭРИ ЁЭРЗЁЭРАЁЭРИ ЁЭРСЁЭРАЁЭРНЁЭРГЁЭРИ ЁЯдвтЬЕЁЯФе", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРИЁЭРОЁЭРНЁЭРИЁЭРВ ЁЭРБЁЭРОЁЭРНЁЭРГ ЁЭРБЁЭРАЁЭРНЁЭРА ЁЭРКЁЭРД ЁЭРХЁЭРИЁЭРСЁЭРЖЁЭРИЁЭРНЁЭРИЁЭРУЁЭРШ ЁЭРЛЁЭРОЁЭРОЁЭРТЁЭРД ЁЭРКЁЭРАЁЭРСЁЭРЦЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРФЁЭРТЁЭРКЁЭРИ ЁЯУЪ ЁЯШОЁЯдй", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРСЁЭРАЁЭРНЁЭРГЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРТЁЭРД ЁЭРПЁЭРФЁЭРВЁЭРЗЁЭРНЁЭРА ЁЭРБЁЭРАЁЭРАЁЭРП ЁЭРКЁЭРА ЁЭРНЁЭРАЁЭРАЁЭРМ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРД ЁЭРЛЁЭРОЁЭРГЁЭРДЁЭРДЁЭРДЁЭРДЁЭРД ЁЯдйЁЯе│ЁЯШ│", 
    "ЁЭРУЁЭРФ ЁЭРАЁЭРФЁЭРС ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРГЁЭРОЁЭРНЁЭРО ЁЭРКЁЭРИ ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРД ЁЭРМЁЭРДЁЭРИ ЁЭРМЁЭРДЁЭРУЁЭРСЁЭРО ЁЭРВЁЭРЗЁЭРАЁЭРЛЁЭРЦЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРМЁЭРАЁЭРГЁЭРАЁЭРСЁЭРЧЁЭРЗЁЭРОЁЭРГ ЁЯЪЗЁЯдйЁЯШ▒ЁЯе╢", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРО ЁЭРИЁЭРУЁЭРНЁЭРА ЁЭРВЁЭРЗЁЭРОЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРУЁЭРДЁЭРСЁЭРА ЁЭРБЁЭРАЁЭРАЁЭРП ЁЭРБЁЭРЗЁЭРИ ЁЭРФЁЭРТЁЭРКЁЭРО ЁЭРПЁЭРАЁЭРЗЁЭРВЁЭРЗЁЭРАЁЭРНЁЭРАЁЭРНЁЭРД ЁЭРТЁЭРД ЁЭРМЁЭРАЁЭРНЁЭРА ЁЭРКЁЭРАЁЭРС ЁЭРГЁЭРДЁЭРЖЁЭРАЁЯШВЁЯС┐ЁЯдй", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРД ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРД ЁЭРМЁЭРДЁЭРИ ЁЭРЗЁЭРАЁЭРИЁЭРС ЁЭРГЁЭРСЁЭРШЁЭРДЁЭРС ЁЭРВЁЭРЗЁЭРАЁЭРЛЁЭРА ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРАЁЯТеЁЯФеЁЯФе", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРУЁЭРДЁЭРЛЁЭРДЁЭРЖЁЭРСЁЭРАЁЭРМ ЁЭРКЁЭРИ ЁЭРТЁЭРАЁЭРСЁЭРИ ЁЭРСЁЭРАЁЭРНЁЭРГЁЭРИЁЭРШЁЭРОЁЭРН ЁЭРКЁЭРА ЁЭРСЁЭРАЁЭРНЁЭРГЁЭРИ ЁЭРКЁЭРЗЁЭРАЁЭРНЁЭРА ЁЭРКЁЭРЗЁЭРОЁЭРЛ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРАЁЯС┐ЁЯдоЁЯШО", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРАЁЭРЛЁЭРДЁЭРЧЁЭРА ЁЭРГЁЭРАЁЭРЛ ЁЭРКЁЭРДЁЭРД ЁЭРГЁЭРЙ ЁЭРБЁЭРАЁЭРЙЁЭРАЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРАЁЭРА ЁЯО╢ тмЖя╕ПЁЯдйЁЯТе", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРД ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРД ЁЭРМЁЭРДЁЭРИ ЁЭРЖЁЭРИЁЭРУЁЭРЗЁЭРФЁЭРБ ЁЭРГЁЭРАЁЭРЛ ЁЭРКЁЭРД ЁЭРАЁЭРПЁЭРНЁЭРА ЁЭРБЁЭРОЁЭРУ ЁЭРЗЁЭРОЁЭРТЁЭРУ ЁЭРКЁЭРАЁЭРСЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРА ЁЯдйЁЯСКЁЯСдЁЯШН", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРА ЁЭРХЁЭРПЁЭРТ ЁЭРБЁЭРАЁЭРНЁЭРА ЁЭРКЁЭРД ЁЭЯРЁЭЯТ*ЁЭЯХ ЁЭРБЁЭРАЁЭРТЁЭРЗ ЁЭРВЁЭРЗЁЭРФЁЭРГЁЭРАЁЭРИ ЁЭРВЁЭРОЁЭРМЁЭРМЁЭРАЁЭРНЁЭРГ ЁЭРГЁЭРД ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРАЁЭРА ЁЯдйЁЯТеЁЯФеЁЯФе", 
    "ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРФЁЭРМЁЭРМЁЭРШ ЁЭРКЁЭРИ ЁЭРВЁЭРЗЁЭРФЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРУЁЭРДЁЭРСЁЭРД ЁЭРЛЁЭРАЁЭРНЁЭРГ ЁЭРКЁЭРО ЁЭРГЁЭРАЁЭРЛ ЁЭРКЁЭРД ЁЭРКЁЭРАЁЭРАЁЭРУ ЁЭРГЁЭРФЁЭРНЁЭРЖЁЭРА ЁЭРМЁЭРАЁЭРГЁЭРАЁЭРСЁЭРВЁЭРЗЁЭРОЁЭРГ ЁЯФкЁЯШВЁЯФе", 
    "ЁЭРТЁЭРФЁЭРН ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРМЁЭРАЁЭРА ЁЭРКЁЭРА ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРА ЁЭРАЁЭРФЁЭРС ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРА ЁЭРБЁЭРЗЁЭРИ ЁЭРБЁЭРЗЁЭРОЁЭРТЁЭРГЁЭРА ЁЯС┐ЁЯШОЁЯСК", 
    "ЁЭРУЁЭРФЁЭРЙЁЭРЗЁЭРД ЁЭРГЁЭРДЁЭРКЁЭРЗ ЁЭРКЁЭРД ЁЭРУЁЭРДЁЭРСЁЭРИ ЁЭРСЁЭРАЁЭРНЁЭРГЁЭРИ ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРПЁЭРД ЁЭРУЁЭРАЁЭРСЁЭРАЁЭРТ ЁЭРАЁЭРУЁЭРА ЁЭРЗЁЭРАЁЭРИ ЁЭРМЁЭРФЁЭРЙЁЭРЗЁЭРД ЁЭРБЁЭРАЁЭРЗЁЭРДЁЭРН ЁЭРКЁЭРД ЁЭРЛЁЭРОЁЭРГЁЭРДЁЭРДЁЭРДЁЭРД ЁЯС┐ЁЯТеЁЯдйЁЯФе", 
    "ЁЭРТЁЭРФЁЭРН ЁЭРМЁЭРАЁЭРГЁЭРАЁЭРСЁЭРВЁЭРЗЁЭРОЁЭРГ ЁЭРЙЁЭРШЁЭРАЁЭРГЁЭРА ЁЭРНЁЭРА ЁЭРФЁЭРВЁЭРЗЁЭРАЁЭРЛ ЁЭРМЁЭРАЁЭРА ЁЭРВЁЭРЗЁЭРОЁЭРГ ЁЭРГЁЭРДЁЭРНЁЭРЖЁЭРД ЁЭРДЁЭРК ЁЭРМЁЭРИЁЭРН ЁЭРМЁЭРДЁЭРИ тЬЕЁЯдгЁЯФеЁЯдй", 
    "ЁЭРАЁЭРПЁЭРНЁЭРИ ЁЭРАЁЭРМЁЭРМЁЭРА ЁЭРТЁЭРД ЁЭРПЁЭРФЁЭРВЁЭРЗЁЭРНЁЭРА ЁЭРФЁЭРТЁЭРКЁЭРО ЁЭРФЁЭРТ ЁЭРКЁЭРАЁЭРАЁЭРЛЁЭРИ ЁЭРСЁЭРАЁЭРАЁЭРУ ЁЭРМЁЭРДЁЭРИ ЁЭРКЁЭРАЁЭРФЁЭРН ЁЭРВЁЭРЗЁЭРОЁЭРГЁЭРНЁЭРДЁЭРД ЁЭРАЁЭРШЁЭРА ЁЭРУЁЭРЗЁЭРАЁЭРАЁЭРА! ЁЭРУЁЭРДЁЭРСЁЭРД ЁЭРИЁЭРТ ЁЭРПЁЭРАЁЭРПЁЭРА ЁЭРКЁЭРА ЁЭРНЁЭРАЁЭРАЁЭРМ ЁЭРЛЁЭРДЁЭРЖЁЭРИ ЁЯШВЁЯС┐ЁЯШ│", 
